import React from "react";
import Projects from "../Projects"
import portfolio from "../../assets/images/portfolio/portfolio-print-des.png"
import "./works.css"


const Works = () => (
  <div>
    <h1>Works Page</h1>

    <h3>Learn About My Design Process and Work</h3>
    <img src={portfolio} alt="Design Portfolio"></img>

  <h3>View Web Projects</h3>
  <Projects/>

  </div>
);

export default Works;
